import React from "react";
import "./Components.css";
import Cell from "./Cell";

class Board extends React.Component {
	state = {
		cells: [],
	};

	componentDidMount() {
		let newCells = [];

		for (let i = 0; i < 10; i++) {
			for (let j = 0; j < 10; j++) {
				newCells.push(Math.floor(Math.random() * 10));
			}
		}

		this.setState({ cells: newCells });
	}

	render() {
		return (
			<div className="board">
				<Cell />
			</div>
		);
	}
}

export default Board;
